import React from "react";
import Entry from "./Entry";
import emojipedia from "../emojipedia";


function createCard(contact) {
  return (
    <Card
      id={contact.id}
      key={contact.id}
      emoji={Entry.emoji}
      name={Entry.name}
      img={contact.imgURL}
      tel={contact.phone}
      email={contact.email}
    />
  );
}

function App() {
  return (
    <div>
      <h1>
        <span>emojipedia</span>
      </h1>

      <dl className="dictionary">
        {emojipedia.map()}
      </dl>
    </div>
  );
}

export default App;
